# Structure for table "app_modulo"
#

DROP TABLE IF EXISTS `app_modulo`;
CREATE TABLE `app_modulo` (
  `mo_idmodulo` int(11) NOT NULL DEFAULT '0',
  `mo_nombre` varchar(100) NOT NULL DEFAULT '',
  `mo_descripcion` varchar(1000) DEFAULT NULL,
  `mo_clasevista` varchar(50) DEFAULT NULL,
